import { createStructuredSelector } from 'reselect';
export const CLEAR_FORM_STATUS: string = `CLEAR_FORM_STATUS`;
export const GET_NUMBER_OF_PLAYERS: string = `GET_NUMBER_OF_PLAYERS`;

export const clearFormStatus = () => {
    return {
        type: CLEAR_FORM_STATUS
    }
}

export const getNumberOfPlayers = () => {
